import React from 'react';
import './App.css';
import Navbar from "./components/Navbar";
import { AuthProvider } from './context/AuthContext';


function App() {
  const isLoggedIn = false;
  const userId = '-1';



  return (
      <AuthProvider>
          <div className="App">
              <div>
                  <Navbar/>
              </div>
          </div>
      </AuthProvider>
  );
}

export default App;
